Kusaka Kabane - Kemono Jihen

Ein Manga der mich direkt fest im Griff hatte als ich die ersten zwei Bände gelesen hatte. Seit dem Sammle ich die Manga! Den Anime haben wir auch geschaut und so wurde meine Frau @hu.Hime ebenfalls in das Fandom gezogen. 😂
Als Kabane dann seinen Nendoroid bekommen hat habe ich mich sehr gefreut. Er ist so unfassbar niedlich und besonders sein Pizzagesicht fängt den kleinen großartig ein! Ich würde mich über weitere Nendoroids des Franchise freuen aber bisher kam da leider nichts. 

